import React from 'react';
import './Add.css';
import Title from '../../components/title/Title';

const Add = () => {
  return (
    <div className='add p-4'>
      <Title title='add doctor' />
      <form className='p-5'>
        <div className='picture d-flex align-items-center gap-3'>
          <div>
            <label for='upload'><i className="fa-solid fa-user p-4"></i></label>
            <input  id='upload' type='file' hidden/>
          </div>
          <p>Upload doctor picture</p>
        </div>
      </form>
    </div>
  )
}

export default Add
